import React from 'react'
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
} from './navElements.js';

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavLink to="/">
                <h1>Logo img tag</h1>
                </NavLink>
                <Bars />
                <NavMenu>
                    <NavLink to="/about" activeStyle></NavLink>
                </NavMenu>

            </Nav>

        </>
    );
};

export default Navbar;
